SHLChunk.vertexProgram:
//Lambert Shader
//Ambient and Diffuse
//Per vertex lighting
uniform float DiffuseCoeff;
void main()
{
    vec4 DiffuseColor = vec4(0.0);
    vec3 normal, lightDir;
    vec4 diffuse;
    float NdotL = 0.0;
    //Vertex Position
    vec4 ecPos = gl_ModelViewMatrix * gl_Vertex;
    /* first transform the normal into eye space and normalize the result */
    normal = normalize(gl_NormalMatrix * gl_Normal);
        //Light 0
        if(gl_LightSource[0].position.w == 0.0) // Directional Light
        {
            /* now normalize the light's direction. Note that according to the
            OpenGL specification, the light is stored in eye space. Also since 
            we're talking about a directional light, the position field is actually 
            direction */
            lightDir = normalize(vec3(gl_LightSource[0].position));
        }
        else //Point or Spot Light
        {
		    lightDir = normalize(vec3(gl_LightSource[0].position-ecPos));
        }
       /* compute the cos of the angle between the normal and lights direction. 
        The light is directional so the direction is constant for every vertex.
       Since these two are normalized the cosine is the dot product. We also 
        need to clamp the result to the [0,1] range. */
        NdotL = NdotL + max(dot(normal, lightDir), 0.0);
        DiffuseColor += NdotL * DiffuseCoeff * gl_FrontMaterial.diffuse * gl_LightSource[0].diffuse * gl_Color;

    //Diffuse Term
    //Set the Color as the diffuse term
    gl_FrontColor = DiffuseColor;
    gl_TexCoord[0] = gl_TextureMatrix[0] * gl_MultiTexCoord0;
    gl_Position = ftransform();
}

SHLChunk.fragmentProgram:
//Lambert Shader
//Ambient and Diffuse
//Per vertex lighting
uniform sampler2D DiffuseTexture;
void main()
{
    vec4 Color = gl_Color; //Diffuse Color
    //For the number of lights
    vec4 LightAmbient = vec4(0.0);
    //Light 0
    LightAmbient += gl_LightSource[0].ambient.rgba;

    //Ambient Color
    Color.rgb += texture2D(DiffuseTexture,gl_TexCoord[0].st).rgb * LightAmbient.rgb;
    //Diffuse Color Map
    Color.rgb = Color.rgb * texture2D(DiffuseTexture,gl_TexCoord[0].st).rgb;
    //Emissive
    Color += gl_FrontMaterial.emission.rgba;
    //No Specular for Lambert
    gl_FragColor = vec4(Color.r,Color.g,Color.b,Color.a);
}

